import React from "react";

const Gift = () => (
  <svg
  className='gift'
    xmlns="http://www.w3.org/2000/svg"
    viewBox="0 0 32 38"
    width="32"
    height="38"
  >
    <defs>
      <image
        id="gift"
        width="63"
        height="75"
        href="data:image/svg+xml;base64,"
      />
    </defs>
    <use
      id="icon-gift.svg"
      transform="matrix(0.508 0 0 0.5 0 0)"
      href="#gift"
    />
  </svg>
);
export default Gift;
